"use strict";Vue.component("ht-tree",{props:{type:{type:Array,require:!0,default:function(){return["zichan","fuzhai","gongtong","quanyi","chengben","sunyi","biaowai"]}},url:{type:String,require:!0},isparentclick:{type:Boolean,require:!1},setting:{require:!1,type:Object},treeData:{require:!1,type:Array,default:function(){return[]}},tid:{require:!1,type:String,default:function(){return"ztree"+Math.random()*Date.parse(new Date)}}},data:function(){return{defaultSetting:{data:{key:{name:"subjectName"},simpleData:{enable:!0,pIdKey:"parentId"}},callback:{beforeClick:function(t,e,n){return!e.isParent},beforeDblClick:function(t,e){return!e.isParent}}}}},methods:{loadData:function(){var a=this;a.isparentclick&&(this.defaultSetting.callback={});var r=$.extend(!0,{},this.defaultSetting,this.setting);if($.isEmptyObject(a.url)){if(!$.isEmptyObject(a.treeData)){var t=$.fn.zTree.init($("#"+a.tid),r,a.treeData);a.$parent.$ztree=t}}else $.ajax({type:"POST",url:a.url,contentType:"application/json",dataType:"json",success:function(t){var n=[];$.each(t.data||{},function(t,e){-1<$.inArray(t,a.type)&&!$.isEmptyObject(e)&&(n=[].concat(n,e))});var e=$.fn.zTree.init($("#"+a.tid),r,n);a.$parent.$ztree=e},error:function(t){console.log(t)}})},evalCallback:function(){var n=this,a={};return $.each(this.setting.callback,function(t,e){a[t]=n.$parent[e]}),a}},mounted:function(){this.loadData()},template:'  <div>           \n       <ul :id="tid" class="ztree"></ul>\n   </div>'});